import React from 'react';
import PropTypes from 'prop-types';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { withStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Avatar from '@material-ui/core/Avatar';
//import ImageIcon from '@material-ui/icons/Image';
//import WorkIcon from '@material-ui/icons/Work';
//import BeachAccessIcon from '@material-ui/icons/BeachAccess';
import Divider from '@material-ui/core/Divider';
//import FontAwesome from '../FontAwesomeIcons'

const styles = theme => ({
  root: {
    width: '100%',
    backgroundColor: theme.palette.background.paper,
    top: "19rem",
    marginLeft: "2rem",
  },
});

function InsetDividers(props) {
  const { classes } = props;
  return (
    <List className={classes.root}>
      <ListItem>
        <Avatar>
          <FontAwesomeIcon icon="book"/>
        </Avatar>
        <ListItemText primary="Books" secondary="Jan 9, 2019" />
      </ListItem>
      <li>
        <Divider variant="inset" />
      </li>
      <ListItem>
        <Avatar>
        <FontAwesomeIcon icon="scroll"/>
        </Avatar>
        <ListItemText primary="Poems" secondary="Jan 7, 2016" />
      </ListItem>
      <Divider variant="inset" component="li" />
      <ListItem>
        <Avatar>
        <FontAwesomeIcon icon="stickynote"/>
        </Avatar>
        <ListItemText primary="Short Stories" secondary="July 20, 2018" />
      </ListItem>
    </List>
  );
}

InsetDividers.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(InsetDividers);
